import * as React from 'react';
import Button from '@mui/material/Button';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import Fade from '@mui/material/Fade';


export default function MenuBarMainPart() {
    const [openedMenu, setOpenedMenu] = React.useState<null | HTMLElement>(null);
    const open = Boolean(openedMenu);
    const handleClick = (event:React.MouseEvent<HTMLElement>) => {
        setOpenedMenu(event.currentTarget);
    }
    const handleClose = () => {
        setOpenedMenu(null);
    }


  return (
      <>
        <li className="tool-item tool-toggler">Файл</li>
        <li className="tool-item tool-toggler">Редактировать</li>
        <li className="tool-item tool-toggler">Изображение</li>
        <li className="tool-item tool-toggler">Помощь</li>
      </>
  )
}
